'''Alistair James''' is an actor. He has appeared in the televisions series ''Bones'' and ''Happy Endings'' and the films ''Prank'' and ''The Evil Within''.

In ''[[Game of Thrones: A Telltale Games Series]]'', he voices [[Britt]].
